import React from 'react';
import { Feature } from '../../components';
import './whatgpt3.css';

const WhatGPT3 = () => {
  return (
    <div className = 'gpt3__whatgpt3 section__margin' id="wgpt3">
      <div className = 'gpt3__whatgpt3-feature'>
        <Feature Title="About Me" Text="I was born in Andhra Pradesh, India. I spent my childhood in different places and since I was in a constant flux, I encountered people from all walks of life and cultures, making me eager to meet new people and strike up a discussion."/>
      </div>
      <div className = 'gpt3__whatgpt3-heading'>
        <h1 className='gradient__text'>Education</h1>
      </div>
      <div className='gpt3__whatgpt3-container'>
        <Feature Title="University of Texas" Text="Masters in Computer Science" Technologies="GPA : 3.5/4"/>
        <Feature Title="Amrita School of Engineering" Text="Predicting flight delay in the month January 2020 in USA. Obtained 89% highest accuracy in comparison to various models. Gained insights using visualizaCons." Technologies="Technologies :- Pandas, numpy, sci-kit"/>
        <Feature Title="Education" Text="At jointure ladyship an insisted so humanity he. Friendly bachelor entrance to on by. As put impossible own apartments b"/>
      </div>
    </div>
  )
}

export default WhatGPT3
